INSERT INTO `eia_assignments` VALUES (1,NULL,'General Question',NULL,'What is your doing','6','2017-09-06 02:52:14','2017-09-06 02:52:14'),(2,NULL,'Specific Question','Air Pollution Control - Environmental Management','YES','7','2017-09-15 22:59:39','2017-09-15 22:59:39'),(3,NULL,'General Question',NULL,'Suka Cantik Properties planning to develop a land at Kuala Sepetang, Taiping as a new township. Area nearby is a gazetted bird sanctuary and a tourist attraction area. Sungai Sepetang flows passing through the proposed project.The proposed project covers 65ha a mix area of 38% of peat swamp and the rest is secondary forest.The township component are 500 housing units, 50 commercial units, 15 light industrial lots, institution and infrastructure.Based on the scenario, explain the process on how to prepare the EIA report.','14','2017-09-18 00:13:12','2017-09-18 00:13:12'),(4,NULL,'General Question',NULL,'Hutan Bandar Sdn Bhd is planning to develop a man-made island less than 50 hectares. The proposed project is located 10 kilometers from a mangrove area.Based on the scenario above and the Environmental Impact Assessment Guideline in Malaysia 2016, explain the process of EIA procedure required.','14','2017-09-18 00:14:01','2017-09-18 00:14:01'),(5,NULL,'General Question',NULL,'ABC Corporation is planning to construct a new railway route. The 150km proposed project is from Putrajaya to Serting Tengah, Negeri Sembilan\r\nthat will pass through Hutan Simpan Kaneboi.Based on the scenario above and the Environmental Impact Assessment Guideline in Malaysia 2016, explain the process of EIA procedure required','14','2017-09-18 00:15:18','2017-09-18 00:15:18'),(6,NULL,'Specific Question','Air Pollution Control - Pollution Control Technology','IA Report on Kenanga Hydroelectric Dam was approved in July 2016 and the project is going to start work in two (2) months. Describe the\r\nprocess involved before the earth work start.','14','2017-09-18 00:15:59','2017-09-18 00:15:59'),(7,NULL,'Specific Question','Air Pollution Control - Impact Assessment','Proposal from EIA study team leader to project proponent on what to do. (ABN)','14','2017-09-18 00:16:48','2017-09-18 00:16:48');
/*!40000 ALTER TABLE `eia_assignments` ENABLE KEYS */;
UNLOCK TABLES;

