ed modelling tools and specifying the\r\nboundary conditions, data input, and output results using figures\r\nand simple presentation methods.',NULL,NULL,NULL,21,'2017-09-17 15:54:56','2017-09-17 15:54:56','M',NULL),(162,NULL,NULL,NULL,NULL,'','33','Which of the following statements are true pertaining to providing a detailed project programed ','','','','',NULL,NULL,NULL,20,'2017-09-17 15:56:00','2017-09-17 15:56:00','H',NULL),(163,NULL,'phpjM13CH.doc','application/msword','pp.png',NULL,'24','Round off 8 433 509 to the nearest million.\r\n	Bundarkan 8 433 509 kepada juta yang terdekat\r\n','','','','',NULL,NULL,NULL,15,'2017-09-17 15:56:02','2017-11-10 03:51:26','M','4'),(164,NULL,NULL,NULL,NULL,'','33','Ahmad is preparing two Terms of Reference (TORs)one for a pipe-laying project,and for a hydroelectricpower project.What is the appropriate extent of information to be included as part of both Terms of Reference (TOR)?','','','','',NULL,NULL,NULL,18,'2017-09-17 15:57:18','2017-09-17 15:57:18','0',NULL),(165,NULL,NULL,NULL,NULL,'','33','Which of the following is a potential sensitive receiver in terms of air quality from\r\na thermal plant project?','','','','',NULL,NULL,NULL,21,'2017-09-17 16:10:37','2017-09-17 16:10:37','E',NULL),(166,NULL,NULL,NULL,NULL,'','33','What is the purpose of project options in an EIA report?','','','','',NULL,NULL,NULL,20,'2017-09-17 16:12:31','2017-09-17 16:12:31','M',NULL),(167,NULL,NULL,NULL,NULL,'','33','What is the requirement for the modelling to be conducted during the process of\r\nimpact assessment methodology?','The rationale for the choice of methodologies shall be discussed.','The modelling exercise shall capture the worst case scenarios','The uncertainties in the models shall be discussed thoroughly.','All modelling studies shall undergo the stages of verification, calibration and validation',NULL,NULL,NULL,20,'2017-09-17 16:14:52','2017-09-17 16:14:52','0',NULL),(168,NULL,NULL,NULL,NULL,'','33','From what perspective an EIA Report is scientifically and technically sound?','The reliability of data and coefficients (constants) used for modelling must\r\nbe accurate and based on local conditions.','The information about impacts has been organized in a concise and\r\ncoherent manner.','The quantitative impact prediction and magnitude must be predicted with\r\nboth mitigating measures including the worst case scenario.','The proposed project and project options are described in a\r\ncomprehensive manner using satellite imagery, diagrams, plans or maps.',NULL,NULL,NULL,20,'2017-09-17 16:17:02','2017-09-17 16:17:02','H',NULL),(169,NULL,NULL,NULL,NULL,'','33','Which are the following statements on “Project Location and Existing Landuse”\r\nare false?','','','','',NULL,NULL,NULL,19,'2017-09-17 16:19:02','2017-09-17 16:19:02','M',NULL),(170,NULL,NULL,NULL,NULL,'','33','Which of the following is not a tool used for impact identification and prediction:','','','','',NULL,NULL,NULL,17,'2017-09-17 16:20:02','2017-09-17 16:20:02','E',NULL),(171,NULL,'php41XEuK.doc','application/msword','Johor percubaan kertas 1.doc','','26','5 minggu 2 hari  2 minggu 6 hari ','','','','',NULL,NULL,NULL,15,'2017-09-17 16:20:33','2017-09-17 16:20:33','M','4'),(172,NULL,NULL,NULL,NULL,'','33','What is the general principle when evaluating impacts on sensitive receptors?','','','','',NULL,NULL,NULL,20,'2017-09-17 16:20:52','2017-09-17 16:20:52','E',NULL),(173,NULL,NULL,NULL,NULL,'','33','Which of the following refers to the biophysical impacts?','Air and water quality','Flora and fauna','Noise levels','Climate and hydrological systems',NULL,NULL,NULL,18,'2017-09-17 16:21:55','2017-09-17 16:21:55','E',NULL),(174,NULL,NULL,NULL,NULL,'','33','Which of the following is indirect impact?','','','','',NULL,NULL,NULL,4,'2017-09-17 16:22:55','2017-09-17 16:22:55','E',NULL),(175,NULL,NULL,NULL,NULL,'','33','Which statement best describe as “impact threshold”?','','','','',NULL,NULL,NULL,21,'2017-09-17 16:23:39','2017-09-17 16:23:39','E',NULL),(176,NULL,NULL,NULL,NULL,'','33','Uncertainty is inherent within the impact assessment process, because','','','','',NULL,NULL,NULL,19,'2017-09-17 16:24:41','2017-09-17 16:24:41','M',NULL),(177,NULL,NULL,NULL,NULL,'','33','What is the purpose of stating limitations and constraints associated with the study methodology such as modelling tools in the EIA study?','','','','',NULL,NULL,NULL,4,'2017-09-17 16:25:33','2017-09-17 16:25:33','H',NULL),(178,NULL,NULL,NULL,NULL,'','33','Which of the following will not serve to result in an improved environmental\r\nperformance for a conventional pipe laying construction?','','','','',NULL,NULL,NULL,4,'2017-09-17 16:26:27','2017-09-17 16:26:27','M',NULL),(179,NULL,NULL,NULL,NULL,'','33','Prior to commencing on field data collection program, it is important for the EIA\r\nconsultant to:','Understands the likely environmental impacts arising from the\r\nproposed project.','Knows where the sensitive receptors are.','Identifies availability of secondary data.','Designs the mitigation measures that may be necessary.',NULL,NULL,NULL,17,'2017-09-17 16:27:40','2017-09-17 16:27:40','M',NULL),(180,NULL,NULL,NULL,NULL,'','33','During survey or sampling, it is necessary to include the following information in\r\nthe EIA report.','survey methodology;','date and time of survey;','quality control measures;','vlocation of the survey',NULL,NULL,NULL,21,'2017-09-17 16:28:51','2017-09-17 16:28:51','M',NULL),(181,NULL,NULL,NULL,NULL,'','33','What is the main criteria for baseline data collection?','','','','',NULL,NULL,NULL,21,'2017-09-17 16:29:49','2017-09-17 16:29:49','E',NULL),(182,NULL,'phpUnGcX7.pdf','application/pdf','eWaris Kertas 1 Matematik.pdf','','26','0.024jutax45','','','','',NULL,NULL,NULL,15,'2017-09-17 16:30:13','2017-10-22 04:09:28','E','4'),(183,NULL,NULL,NULL,NULL,'','33','What type of development that requires geological terrain mapping report and\r\nerosion risk map during the preparation of EIA report?','Development that subject to submission of EIA Report.','Development on hills.','Development on highlands.','Development on hills and highlands that subject to submission of EIA\r\nreport.',NULL,NULL,NULL,21,'2017-09-17 16:31:00','2017-09-17 16:31:00','M',NULL),(184,NULL,NULL,NULL,NULL,'','33','What are the roles of an EIA consultant team leader in preparing the EIA report?','The original report by the SMCs is not required to submit in the EIA\r\nreport.','Coordinate the writing of the EIA Report and thoroughly review it to\r\nensure it encompasses all the elements in the TOR.','Make sure the EIA Report is comprehensive, coherent, balanced,\r\nimpartial and technically acceptable for submission to the authorities.','Extract and summarize the major findings of the reports prepared by\r\nsubject matter consultants (SMCs) and place them in the appropriate\r\nchapters in the EIA Report.',NULL,NULL,NULL,18,'2017-09-17 16:32:20','2017-09-17 16:32:20','H',NULL),(185,NULL,NULL,NULL,NULL,'','33','An Environmental Management Plan (EMP) shall','Provide a list of significant impacts of the project from the EIA Report.','Establish appropriate standard and procedures for mitigation and\r\nmonitoring the impact.','To identify sensitive receptor within zone of study','Assign responsibility for the implementation and management of the EMP',NULL,NULL,NULL,19,'2017-09-17 16:33:38','2017-09-17 16:33:38','0',NULL),(186,NULL,NULL,NULL,NULL,'','33','Which of the following statement(s) about Environmental Management Plan\r\n(EMP) is correct?','The EMP can be prepared and submitted to the DOE by any professional\r\nengineer.','Submission of EMP must be included with the Land Disturbing Pollution\r\nPrevention and Mitigation Measures (LDP2M2) documen','EMP submission requirement is normally stipulated as one of the EIA\r\nApproval Conditions (COAs) and the EMP provision content is not\r\nrequired in the EIA report.','Procedure to process submitted EMP is through presentation of COA\r\nExecution Plan